import React, {useState, useEffect} from 'react';

const ArticlesListPage = () => {
    const [tweetInfo, setTweetInfo] = useState({ id: 0, text: ''});
    useEffect(() => {
        setTweetInfo({
            id:123, 
            text:'this is my tweet'
        });
    });


    return(
        <>
        <p>Tweets:</p> 
        <p>{tweetInfo.id}</p>
        <p>{tweetInfo.text}</p>
        </>
    )
}

export default ArticlesListPage;
